import React from "react";
import "./Login.scss";
import { Button } from "@mui/material";

const Login = () => {
  return (
    <div className="login">
      <div className="loginLogo">
        <img src="./discordLogo.png" alt="" />
      </div>

      <button></button>
    </div>
  );
};

export default Login;
